let isNavListVisible=!1;function clickHandle(e,t){let n,l,s;for(l=document.getElementsByClassName("content"),n=0;n<l.length;n++)l[n].style.display="none";for(s=document.getElementsByClassName("tab_btn"),n=0;n<s.length;n++)s[n].className=s[n].className.replace(" active","");document.getElementById(t).style.display="block",e.currentTarget.className+=" active"}function changeLanguage(e){let t=document.getElementsByClassName("lng");for(i=0;i<t.length;i++)t[i].className="lng";t[e].className+=" selected_lng"}function toggleList(){isNavListVisible=!isNavListVisible;let e=document.getElementById("navMenu");e.style.display=isNavListVisible?"flex":"none"}function menuItemSelected(e){hideList(),document.getElementById("selectedItemNav").innerText=e}function hideList(){if(document.body.clientWidth<479){isNavListVisible=!1,document.getElementById("navMenu").style.display="none"}}